import React, { Component } from "react";

export class Address extends Component {
  state = {
    step: 1,
    firstName: "",
    lastName: "",
    phoneNumber: "",
    email: "",
    streetAddress: "",
    city: "",
    unitNumber: "",
    postalCode: "",
  };
  render() {
    return <div></div>;
  }
}

export default Address;
